import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <h1 style={{ color: "var(--primary)" }}>Welcome to Zottry</h1>
        <p style={{ color: "var(--text-light)" }}>Your Chance, Your Change</p>
      </header>
    </div>
  );
}

export default App;
